import React from 'react';
import Container from "@mui/material/Container";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import WaterInput from './WaterInput';

const WaterBody = (props) => {
  return (
    <Container sx={{width: 1000, height: 500, backgroundColor: "white", borderRadius: 5}}>
        <Box sx={{ height: 480, width: 550, border: "1px solid black", display: "inline-block", mt: 1, borderRadius: 5}}>
        <div>
            {props.water.map((water, index) => ( 
             <Box sx={{ width: 530, height: 30, border: "1px solid black", borderRadius: 5, marginTop: 2 }}>
              <div key={index} className='items'>
                  <p>Title:   {water.title}</p>
                  <p>Price: {water.price}</p>
                  <p>Description: {water.description}</p>
              </div>
            </Box>
            ))}
        </div>


        </Box>
        <Box sx={{ position: "absolute", mt: 15, ml: -53, display: "inline-block"}}>
            <WaterInput />
        </Box>
    </Container>
  )
}

export default WaterBody;
